import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import ClienteList from './components/ClienteList';
import AddCliente from './components/AddCliente';
import EditCliente from './components/EditCliente';

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <h1>Gerenciamento de Clientes</h1>
          <nav>
            <Link to="/">Lista de Clientes</Link>
            <Link to="/add">Adicionar Cliente</Link>
          </nav>
        </header>
        <Switch>
          <Route path="/" exact component={ClienteList} />
          <Route path="/add" component={AddCliente} />
          <Route path="/edit/:id" component={EditCliente} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
